    public class PredictWavaTime
    {
        public static float IdealAge(float dist)
        {
            return Wava.IdealAge(Predict.Sex, dist);
        }

        public static float IdealTime(float dist, float age)
        {
            return Wava.IdealTime(Predict.Sex, dist, age);
        }

        public static double WavaPredict(double new_dist, double old_dist, TimeSpan old_time)
        {
            return WavaPredict(new_dist, old_dist, old_time, Predict.CurrentAge, Predict.CurrentAge);
        }
        public static double WavaPredict(double new_dist, double old_dist, TimeSpan old_time, float newAge, float oldAge)
        {
            return WavaPredict(new_dist, old_dist, old_time.TotalSeconds, newAge, oldAge);
        }
        public static double WavaPredict(double new_dist, double old_dist, double old_time, float newAge, float oldAge)
        {
            float oldIdealTime = Wava.IdealTime(Predict.Sex, (float)old_dist, oldAge);
            float newIdealTime = Wava.IdealTime(Predict.Sex, (float)new_dist, newAge);
            double new_time = old_time / oldIdealTime * newIdealTime;
            if (double.IsNaN(new_time))
            { }
            return new_time;
        }

        private class Wava
        {
            //Sex, Age, Distance stored as int for efficiency
            private static float[, ,] list = null;
            const int minAge = 5;
            const int maxAge = 100;
            private static int[] aDist;

            public static float IdealAge(AthleteSex ASex, float dist)
            {
                if (Wava.list == null)
                {
                    Wava.list = WavaTable();
                }

                int sex = 1;
                if (ASex == AthleteSex.Female) { sex = 0; }

                int dlow = lowDistIndex(dist);
                if (Math.Abs(dist - aDist[dlow + 1]) < Math.Abs(dist - aDist[dlow]))
                {
                    dlow++;
                }

                int alow = 0;
                for (int i = 1; i <= maxAge - minAge; i++)
                {
                    if (Wava.list[sex, i, dlow] < Wava.list[sex, alow, dlow])
                    {
                        alow=i;
                    }
                }

                return alow + minAge;
            }

            public static float IdealTime(AthleteSex ASex, float dist, float age)
            {
                if (Wava.list == null)
                {
                    Wava.list = WavaTable();
                }

                //The array is "complete" - otherwise there have to be some interpolations

                int sex = 1;
                if (ASex == AthleteSex.Female) { sex = 0; }

                int alow = (int)age - minAge;
                if (alow < 0) { alow = 0; }
                int maxIndex = maxAge - minAge - 1;
                if (alow > maxIndex) { alow = maxIndex; }

                int dlow = lowDistIndex(dist);

                float af = (age - alow - minAge); //high-low diff always 1
                float df = (dist - aDist[dlow]) / (aDist[dlow + 1] - aDist[dlow]);

                float time =
                       (1 - af) * (1 - df) * Wava.list[sex, alow + 0, dlow + 0] +
                       (1 - af) * (0 + df) * Wava.list[sex, alow + 0, dlow + 1] +
                       (0 + af) * (1 - df) * Wava.list[sex, alow + 1, dlow + 0] +
                       (0 + af) * (0 + df) * Wava.list[sex, alow + 1, dlow + 1];

                return time;
            }

            private static int lowDistIndex(float dist)
            {
                int dlow = 0;
                if (dist <= aDist[0])
                {
                    dlow = 0;
                }
                else if (dist >= aDist[aDist.Length - 1])
                {
                    dlow = aDist.Length - 2;
                }
                else
                {
                    for (int i = 1; i < aDist.Length; i++)
                    {
                        if (dist < aDist[i])
                        {
                            dlow = i - 1;
                            break;
                        }
                    }
                }
                return dlow;
            }

